import{_ as e,o,c as a,a as c}from"./app.ed522904.js";const P=JSON.parse('{"title":"\u526A\u8F91\u8F6F\u4EF6\u9009\u62E9","description":"","frontmatter":{},"headers":[],"relativePath":"channel/video/software.md","lastUpdated":1656606109000}'),d={name:"channel/video/software.md"},t=c('<h1 id="\u526A\u8F91\u8F6F\u4EF6\u9009\u62E9" tabindex="-1">\u526A\u8F91\u8F6F\u4EF6\u9009\u62E9 <a class="header-anchor" href="#\u526A\u8F91\u8F6F\u4EF6\u9009\u62E9" aria-hidden="true">#</a></h1><p>\u76EE\u524D\u5E02\u9762\u4E0A\u53EF\u4EE5\u9009\u62E9\u7684\u526A\u8F91\u8F6F\u4EF6\u53EF\u592A\u591A\u4E86\u3002\u4ED8\u8D39\u8F6F\u4EF6\u6709\u6709\u82F9\u679C\u65D7\u4E0B\u7684 <code>Final Cut Pro</code> \uFF0CAdobe \u65D7\u4E0B\u7684 <code>Adobe Premiere Pro</code>\uFF08\u4EBA\u4EEC\u4E00\u822C\u53EB\u4ED6 Pr\uFF0C\u4EE5\u4E0B\u5C31\u7528 Pr \u6765\u4EE3\u66FF\uFF09\u3002\u8FD8\u6709\u53EF\u4EE5\u514D\u8D39\u4F7F\u7528\u7684 <code>\u8FBE\u82AC\u5947</code>\uFF08\u8FD9\u6B3E\u8F6F\u4EF6\u4E5F\u6709\u4ED8\u8D39\u7248\u672C\uFF0C\u662F\u4E70\u65AD\u5236\u7684\uFF09\uFF0C \u6296\u97F3\u7684 <code>\u526A\u6620</code> \uFF0C\u54D4\u54E9\u54D4\u54E9\u7684 <code>\u5FC5\u526A</code>\u7B49\u3002\u5982\u6B64\u591A\u7684\u8F6F\u4EF6\u6211\u4EEC\u8BE5\u600E\u4E48\u9009\u62E9\u5462\uFF1F</p><p>\u5982\u679C\u60A8\u4E4B\u524D\u4F7F\u7528 PS\u3001AE \u7B49\uFF0C\u60A8\u53EF\u4EE5\u76F4\u63A5\u9009\u62E9 Pr\uFF0C\u53EF\u4EE5\u548C\u5DF2\u6709\u7684\u751F\u6001\u8FDB\u884C\u7ED3\u5408\uFF0C\u8BA9\u60A8\u7684\u5DE5\u4F5C\u66F4\u52A0\u7684\u65B9\u4FBF\u3002</p><p>\u5982\u679C\u60A8\u662F Mac \u7528\u6237\u7684\u8BDD\uFF0C\u53EF\u4EE5\u9009\u62E9 <code>Final Cut Pro</code> \u6765\u8FDB\u884C\u526A\u8F91\uFF0C1998 \u7684\u4E70\u65AD\u5236\u5BF9\u4E8E adobe \u5168\u5BB6\u6876\u6765\u8BF4\u4E5F\u8FD8\u53EF\u4EE5\u63A5\u53D7\u3002</p><p>\u5982\u679C\u60A8\u662F\u65B0\u624B\u7684\u8BDD\uFF0C\u60F3\u5165\u95E8\u526A\u8F91\u5E76\u4E14\u505A\u4E00\u4E9B\u4E25\u8083\u7684\u521B\u4F5C\uFF0C\u6211\u5F3A\u70C8\u63A8\u4ECB\u60A8\u4F7F\u7528 <code>\u8FBE\u82AC\u5947</code>\uFF0C\u4F60\u53EF\u4EE5\u5728\u8FBE\u82AC\u5947\u7684\u514D\u8D39\u7248\u672C\u91CC\u4F7F\u7528\u5176\u7EDD\u5927\u591A\u6570\u7684\u529F\u80FD\uFF0C\u7B49\u5230\u8FD9\u4E9B\u529F\u80FD\u4E0D\u80FD\u6EE1\u8DB3\u60A8\u7684\u9700\u6C42\u7684\u65F6\u5019\uFF0C\u60A8\u53EF\u4EE5\u5347\u7EA7\u5230\u4ED8\u8D39\u7248\u7EE7\u7EED\u4F7F\u7528\u3002\u800C\u4E14\u6211\u76F8\u4FE1\u5982\u679C\u5230\u4E86\u8FD9\u4E2A\u9636\u6BB5\uFF0C2000 \u591A\u7684\u4EF7\u683C\u5BF9\u4E8E\u60A8\u6765\u8BF4\u4E5F\u4E0D\u662F\u5F88\u591A\u4E86\u3002</p><p>\u5982\u679C\u60A8\u53EA\u662F\u60F3\u5FEB\u901F\u4E0A\u624B\u4E00\u6B3E\u8F6F\u4EF6\u5E76\u4E14\u505A\u51FA\u4E00\u4E9B\u6548\u679C\u7684\u8BDD\u6211\u63A8\u4ECB\u60A8\u4F7F\u7528<code>\u526A\u6620</code>\uFF0C\u5B8C\u5168\u514D\u8D39\u4E14\u529F\u80FD\u5F3A\u5927\u3002\u6709\u7740\u5F3A\u5927\u7684\u7D20\u6750\u5E93\uFF0C\u8BA9\u60A8\u8D77\u6B65\u9636\u6BB5\u7684\u7D20\u6750\u4E0D\u662F\u90A3\u4E48\u96BE\u627E\uFF1B\u6709\u7740\u5F3A\u5927\u7684\u8BED\u97F3\u8BC6\u522B\u529F\u80FD\uFF0C\u6709\u5F88\u591A\u4E13\u4E1A\u7684\u89C6\u9891\u5236\u4F5C\u8005\u4E5F\u5728\u7528\u5176\u8FDB\u884C\u5B57\u5E55\u7684\u5236\u4F5C\u3002</p><p>\u603B\u4E4B\uFF0C\u6CA1\u6709\u6700\u597D\u7684\u8F6F\u4EF6\uFF0C\u53EA\u6709\u6700\u9002\u5408\u7684\u8F6F\u4EF6\u3002\u4E00\u4E2A\u6B63\u771F\u7684\u9AD8\u624B\u9762\u524D\uFF0C\u4E00\u5207\u90FD\u662F\u865A\u5984\u7684\u3002\u4E0D\u8FC7\u5BF9\u4E8E\u4E00\u4E2A\u65B0\u624B\u6765\u8BF4\uFF0C\u9009\u62E9\u4E00\u6B3E\u8D81\u624B\u7684\u5175\u5668\u8FD8\u662F\u9700\u8981\u81EA\u5DF1\u591A\u53BB\u5C1D\u8BD5\u3002</p>',7),r=[t];function n(s,_,p,i,l,h){return o(),a("div",null,r)}const m=e(d,[["render",n]]);export{P as __pageData,m as default};
